import React, { Component } from 'react'
import axios from "axios"
import Img from "./img.jpg"

class Gallery extends Component {

    state = {
        images : []
    }
    
    componentDidMount() {
        axios.get("https://pixabay.com/api/?key=19221012-164b9cad7ac65bf4cf31b1543")
        .then(image => {
            console.log(image.data);
            this.setState({
                images : image.data
            })
        })
    }
    render() {
        return (
            <div className="items">
                <div className="item">
                <img src={Img} width="640" height="426" />
                </div>

                {this.state.images.map(gallery => 

                    <div className="item">
                    <img src={gallery.largeImageUR} width="640" height="426" />
                    </div>
                    
                )}
            </div>
        )
    }
}

export default Gallery
